from typing import List
'''
There is a country of n cities numbered from 0 to n - 1. In this country, there is a road connecting every pair of cities.
There are m friends numbered from 0 to m - 1 who are traveling through the country. Each one of them will take a path consisting of some cities. Each path is represented by an integer array that contains the visited cities in order. The path may contain a city more than once, but the same city will not be listed consecutively.
Given an integer n and a 2D integer array paths where paths[i] is an integer array representing the path of the ith friend, return the length of the longest common subpath that is shared by every friend's path, or 0 if there is no common subpath at all.
A subpath of a path is a contiguous sequence of cities within that path.

Example 1:
Input: n = 5, paths = [[0,1,2,3,4],
                       [2,3,4],
                       [4,0,1,2,3]]
Output: 2
Explanation: The longest common subpath is [2,3].

Example 2:
Input: n = 3, paths = [[0],[1],[2]]
Output: 0
Explanation: There is no common subpath shared by the three paths.

Example 3:
Input: n = 5, paths = [[0,1,2,3,4],
                       [4,3,2,1,0]]
Output: 1
Explanation: The possible longest common subpaths are [0], [1], [2], [3], and [4]. All have a length of 1.
 

Constraints:
1 <= n <= 105
m == paths.length
2 <= m <= 105
sum(paths[i].length) <= 105
0 <= paths[i][j] < n
The same city is not listed multiple times consecutively in paths[i].
'''
from collections import defaultdict
from itertools import zip_longest, islice
from math import floor, log2
class Solution:
    def longestCommonSubpath2(self, n: int, paths: List[List[int]]) -> int:
        factor = 1<<17
        mod = 2147483647
        d = 1<<17
        q = (1<<128) - 159
        def lengthExistForTarget(target):
            h = (1<<(17*target-17))%q
            multiplier = (factor ** target) % mod
            ht = defaultdict(lambda: defaultdict(set))
            for j, path in enumerate(paths):
                if target > len(path):
                    return False
                cur_hash = 0
                i = 0
                while i < target:
                    cur_hash = (cur_hash * factor + path[i]) % mod
                    i += 1
                key = 0
                if j == 0 or cur_hash in ht:
                    ht[cur_hash][key].add(j)
                    if (len(ht[cur_hash][key]) == len(paths)):
                        return True
                while i < len(path):
                    cur_hash = (cur_hash * factor + path[i] - path[i-target] * multiplier) % mod
                    assert cur_hash >= 0
                    i += 1
                    key = tuple(path[i-target:i])
                    # key = 0
                    if j == 0 or cur_hash in ht:
                        ht[cur_hash][key].add(j)
                        if (len(ht[cur_hash][key]) == len(paths)):
                            return True
            return False
        a, b = 0, min([len(p) for p in paths]) + 1
        while True:
            mid = (a+b)//2
            # print(a,b,mid)
            res = lengthExistForTarget(mid)
            if res:
                a = mid
                if b == a + 1:
                    return a
            else:
                b = mid
                if b == a + 1:
                    return a
        return -1

    def longestCommonSubpath(self, n, paths):
        def merge(l):
            ls = sorted(list(set(l)))
            index = {v: i for i, v in enumerate(ls)}
            return [index[v] for v in l]
        def suffixArray(s):
            line = merge(s)
            n, k, ans = len(s), 1, [line]
            while max(line) < n - 1:
                line = merge([a * (n + 1) + b + 1 for (a, b) in
                     zip_longest(line, islice(line, k, None), fillvalue = -1)])
                ans, k = ans + [line], k << 1
                print(s, ans)
            return ans
        def compare(i, j, l, k):
            k1 = min(k, len(c) - 1)
            a = (c[k1][i], c[k1][(i+l-(1<<k))%n])
            b = (c[k1][j], c[k1][(j+l-(1<<k))%n])
            return 0 if a == b else 1 if a < b else -1
        nums, prs = [], []
        for i, p in enumerate(paths):
            nums.extend(p)
            nums.append(-1-i)
            prs.extend([i+1]*len(p))
            prs.append(-1-i)
        nums += [-float("inf")]
        n, m = len(nums), len(paths)
        c = suffixArray(nums)
        sa = [0]*(n+1)
        for i, k in enumerate(c[-1]):
            sa[k] = i
        parts = {j:i for i,j in zip(prs, range(n-1))}
        beg, end = 0, min(len(p) for p in paths) + 1
        while beg + 1 < end:
            mid = (beg + end)//2
            mid_log, a = floor(log2(mid)), 0
            groups = defaultdict(list)
            for i in range(1, n):
                q = compare(sa[i-1], sa[i], mid, mid_log)
                a += q
                groups[a].append(sa[i])
            Found = False
            for gr in groups.values():
                if len(gr) < m: continue
                if len(set(parts[ind] for ind in gr)) == m:
                    Found = True
                    break
            if Found :
                beg = mid
            else:
                end = mid

        return beg

